import React, { useContext } from 'react'
import Context from '../../components/Context'
import './Weather.css'
import icon_200_201_202_day_oll from '../../images/200-202d.png'
import icon_200_201_202_night_oll from '../../images/200-202n.png'
import icon_230_231_232_233_day_oll from '../../images/230-233d.png'
import icon_230_231_232_233_night_oll from '../../images/230-233n.png'
import icon_300_301_302_oll from '../../images/300-302.png'
import icon_500_501_511_900_oll_520_522_day from '../../images/500,501,511,900,520d,522d.png'
import icon_520_521_522_night_oll from '../../images/520-522n.png'
import icon_521_day from '../../images/521d.png'
import icon_502_oll from '../../images/502.png'
import icon_600_610_621_day_oll from '../../images/600,610,621(d).png'
import icon_600_610_621_night_oll from '../../images/600,610,621(n).png'
import icon_601_602_622_oll from '../../images/601,602,622.png'
import icon_611_612_oll from '../../images/611,612.png'
import icon_623_oll from '../../images/623.png'
import icon_700_711_721_731_741_751_day_oll from '../../images/700,711,721,731,741,751(d).png'
import icon_700_711_721_731_741_751_night_oll from '../../images/700,711,721,731,741,751(n).png'
import icon_800_day from '../../images/800d.png'
import icon_800_night from '../../images/800n.png'
import icon_801_802_day from '../../images/801,802(d).png'
import icon_801_802_night from '../../images/801,802(n).png'
import icon_803_day from '../../images/803d.png'
import icon_803_night from '../../images/803n.png'
import icon_804_oll from '../../images/804.png'

export default function Weather() {

  const arrData = useContext(Context) 

  const data = arrData.weatherData[0]

  let srcWeather

  if(data && (data.weather.icon === 't01d' || data.weather.icon === 't02d' || data.weather.icon === 't03d')){
    srcWeather = icon_200_201_202_day_oll
  }
  if(data && (data.weather.icon === 't01n' || data.weather.icon === 't02n' || data.weather.icon === 't03n')){
    srcWeather = icon_200_201_202_night_oll
  }
  if(data && (data.weather.icon === 't04d' || data.weather.icon === 't05d')){
    srcWeather = icon_230_231_232_233_day_oll
  }
  if(data && (data.weather.icon === 't04n' || data.weather.icon === 't05n')){
    srcWeather = icon_230_231_232_233_night_oll
  }
  if(data && (data.weather.icon === 'd01d' || data.weather.icon === 'd02d' || data.weather.icon === 'd03d' || data.weather.icon === 'd01n' || data.weather.icon === 'd02n' || data.weather.icon === 'd03n')){
    srcWeather = icon_300_301_302_oll
  }
  if(data && (data.weather.icon === 'r01d' || data.weather.icon === 'r02d' || data.weather.icon === 'r01n' || data.weather.icon === 'r02n' || data.weather.icon === 'f01d' || data.weather.icon === 'f01n' || data.weather.icon === 'u00d' || data.weather.icon === 'u00n' || data.weather.icon === 'r04d' || data.weather.icon === 'r06d')){
    srcWeather = icon_500_501_511_900_oll_520_522_day
  }
  if(data && (data.weather.icon === 'r04n' || data.weather.icon === 'r05n' || data.weather.icon === 'r06n')){
    srcWeather = icon_520_521_522_night_oll
  }
  if(data && (data.weather.icon === 'r05d')){
    srcWeather = icon_521_day
  }
  if(data && (data.weather.icon === 'r03d' || data.weather.icon === 'r03n')){
    srcWeather = icon_502_oll
  }
  if(data && (data.weather.icon === 's01d' || data.weather.icon === 's04d')){
    srcWeather = icon_600_610_621_day_oll
  }
  if(data && (data.weather.icon === 's01n' || data.weather.icon === 's04n')){
    srcWeather = icon_600_610_621_night_oll
  }
  if(data && (data.weather.icon === 's02d' || data.weather.icon === 's03d' || data.weather.icon === 's02n' || data.weather.icon === 's03n')){
    srcWeather = icon_601_602_622_oll
  }
  if(data && (data.weather.icon === 's05d' || data.weather.icon === 's05n')){
    srcWeather = icon_611_612_oll
  }
  if(data && (data.weather.icon === 's06d' || data.weather.icon === 's06n')){
    srcWeather = icon_623_oll
  }
  if(data && (data.weather.icon === 'a01d' || data.weather.icon === 'a02d' || data.weather.icon === 'a03d' || data.weather.icon === 'a04d' || data.weather.icon === 'a05d' || data.weather.icon === 'a06d')){
    srcWeather = icon_700_711_721_731_741_751_day_oll
  }
  if(data && (data.weather.icon === 'a01n' || data.weather.icon === 'a02n' || data.weather.icon === 'a03n' || data.weather.icon === 'a04n' || data.weather.icon === 'a05n' || data.weather.icon === 'a06n')){
    srcWeather = icon_700_711_721_731_741_751_night_oll
  }
  if(data && (data.weather.icon === "c01d")){
    srcWeather = icon_800_day
  }
  if(data && (data.weather.icon === "c01n")){
    srcWeather = icon_800_night
  }
  if(data && (data.weather.icon === "c02d")){
    srcWeather = icon_801_802_day
  }
  if(data && (data.weather.icon === "c02n")){
    srcWeather = icon_801_802_night
  }
  if(data && (data.weather.icon === "c03d")){
    srcWeather = icon_803_day
  }
  if(data && (data.weather.icon === "c03n")){
    srcWeather = icon_803_night
  }
  if(data && (data.weather.icon === 'c04d' || data.weather.icon === 'c04n')){
    srcWeather = icon_804_oll
  }


  return (
  <div className='weather-wrapper'>
      {data && (
        <div>
          <div className="weather">
            <div className="temperature">
                <span className='sign'>{data.temp > 0 ? '+' : 'âˆ’'}</span>
                <h1>{Math.round(Math.abs(data.temp))}Â°</h1>
            </div>
            <img src={srcWeather} alt={data.weather.icon} />
          </div>
          <div className="description">
            <h4>{arrData.nameCity}: {data.weather.description.toLowerCase()}</h4>
          </div>
          <div className="details">
            <p>{data.sunrise}</p>
            <p>{data.sunset}</p>
            <p>{arrData.timeCity}</p>
          </div>
        </div>
      )}
  </div>
  )
}
